export default class DataPage extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            dat: []
         };
    }

    componentDidMount() {
        $.ajax({
            url: './getdata.php',
            type: "GET",
            dataType: "json",
            success: function (data) {
